Answer: You can use the `localeCompare` method to sort strings in a case-sensitive manner. Here is an example:

```javascript
const arr = ['Zebra', 'apple', 'zebra', 'Apple'];

arr.sort((a, b) => a.localeCompare(b));

console.log(arr); // Output: ["Apple", "Zebra", "apple", "zebra"]
```

This will sort the array in a case-sensitive manner, so uppercase letters will come before lowercase letters.

If you want to sort in a case-insensitive manner, you can convert both strings to lowercase or uppercase before comparing:

```javascript
const arr = ['Zebra', 'apple', 'zebra', 'Apple'];

arr.sort((a, b) => a.toLowerCase().localeCompare(b.toLowerCase()));

console.log(arr); // Output: ["Apple", "apple", "Zebra", "zebra"]
```

Note that `localeCompare` is supported in most modern browsers, but if you need to support older browsers, you may need to use a different approach.


